import { Container,Row,Col } from 'react-bootstrap';

import '../style/home.css'

function Home() {
    return (
        <div>
            <Container>
                <Row>
                    <Col md={4}>1</Col>
                    <Col md={8}>2 </Col>
                </Row>
            </Container>
        </div>
    )
}

export default Home
